import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import React, { useState, useEffect } from "react";
import axios from "axios";
import Rating from '@material-ui/lab/Rating';



export default function FeedBackDiolag({stateChanger, ...rest}) {
  const [open, setOpen] = useState(false);
  const [mainTopic, setTopic] = useState("");
  const [subTopic, setSubTopic] = useState("");
  const [value,setValue] = useState(2);

  stateChanger(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const createTopic = () => {
    if(subTopic === ""){
    var data = {
        "title":mainTopic
 }
    var auth = JSON.parse(localStorage.getItem('auth'));
    axios.post("http://localhost:8080/api/topic/add/main",data,auth).then(response => {
        console.log("succesful");
         }
       );   
    }else{
        var credentials = localStorage.getItem('credentials');
        console.log(credentials);
        axios.post("http://localhost:8080/api/topic/add/"+ mainTopic, subTopic,{
          headers:{
            'Authorization': 'Basic ' + credentials,
            'Content-Type': 'application/json'
          }
        }).then(response => {
        console.log(subTopic);

         }
       );  
    }
    stateChanger(true);
    setOpen(false);
}

  return (
    <div>
      <Button variant="contained" color="primary" onClick={handleClickOpen}>
          Complete Phase
      </Button>
      <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
        <DialogTitle id="form-dialog-title"> Evaluation </DialogTitle>
        <DialogContent>
          <DialogContentText>
              Please write your assesment and rate the process
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="Topic"
            label="assesment"
            fullWidth
            value = {mainTopic}
            onChange = {e => setTopic(e.target.value)}
          />
        <Rating
          name="simple-controlled"
          value={value}
          onChange={(event, newValue) => {
            setValue(newValue);
          }}
        />

        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={createTopic} color="primary">
            Create topic
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
